import React, {Component} from 'react';
import skills from './skills'

class Skills extends Component{
    constructor(){
        super();
    }

    render(){
        const skillRow = skills.map((skill,i)=>{
            return(
                <div>
                    {skill.category}
                    {skill.name}
                    {skill.initValue}
                </div>
            )
        })

        // console.log(skills[0]);
        return(
            <div>
                <h2>Sample</h2>
                {skillRow}
            </div>
        )
    }
}

export default Skills;
